class Routes extends Component {
  render() {
    return (
      <div>
        <Switch>
          <Route path='/Login' component={Login} />
          <Route path='/Cart' component={Cart} />
          <Route path='/product/:id' component={ProductDetails} />
          <Route path='/' component={HomeScreen} />
        </Switch>
      </div>
    );
  }
}

